import React, { Fragment, useContext, useEffect, useState } from "react";
import { DashboardContext } from "./";
import { GetAllData } from "./Action";

const DashboardCard = (props) => {
  const { data, dispatch } = useContext(DashboardContext);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);
        setError(null);

        console.log("DashboardCard: Starting data fetch...");
        await GetAllData(dispatch);
        console.log("DashboardCard: Data fetch completed successfully");

        setLoading(false);
      } catch (err) {
        console.error("Error in DashboardCard:", err);
        setError(err.message || "Failed to load dashboard data");
        setLoading(false);
      }
    };

    fetchData();
  }, [dispatch]);

  // Enhanced debugging - log the entire data structure
  useEffect(() => {
    console.log("=== DASHBOARD DATA DEBUG ===");
    console.log("Full data object:", data);
    console.log("data.totalData:", data.totalData);
    console.log("Type of data.totalData:", typeof data.totalData);
    console.log("Keys in data.totalData:", data.totalData ? Object.keys(data.totalData) : 'undefined');

    if (data.totalData) {
      Object.entries(data.totalData).forEach(([key, value]) => {
        console.log(`${key}: ${value} (type: ${typeof value})`);
      });
    }
    console.log("=== END DEBUG ===");
  }, [data]);

  // Helper function to safely get values with enhanced debugging
  const getValue = (key) => {
    console.log(`Getting value for key: ${key}`);

    if (!data) {
      console.warn(`No data object found when getting ${key}`);
      return 0;
    }

    if (!data.totalData) {
      console.warn(`No totalData found when getting ${key}`);
      return 0;
    }

    if (typeof data.totalData[key] === 'undefined') {
      console.warn(`Key ${key} is undefined in totalData:`, data.totalData);
      return 0;
    }

    const value = data.totalData[key];
    console.log(`Value for ${key}: ${value} (type: ${typeof value})`);

    // Ensure it's a number
    if (typeof value === 'number') {
      return value;
    }

    // Try to convert to number if it's a string
    if (typeof value === 'string') {
      const numValue = parseInt(value) || 0;
      console.log(`Converted string "${value}" to number: ${numValue}`);
      return numValue;
    }

    console.warn(`Unexpected value type for ${key}:`, value);
    return 0;
  };

  if (loading) {
    return (
      <div className="m-4 flex justify-center items-center py-8">
        <div className="flex flex-col items-center space-y-4">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-gray-900"></div>
          <p className="text-gray-600">Loading dashboard data...</p>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="m-4 flex justify-center items-center py-8">
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded text-center max-w-md">
          <strong>Error:</strong> {error}
          <br />
          <button 
            onClick={() => window.location.reload()} 
            className="mt-4 px-4 py-2 bg-red-500 text-white rounded hover:bg-red-600"
          >
            Retry
          </button>
          <br />
          <small className="text-gray-600 mt-2 block">
            Check the browser console for more details
          </small>
        </div>
      </div>
    );
  }

  return (
    <Fragment>
      {/* Debug Information - Remove in production */}
      <div className="m-4 p-4 bg-gray-100 rounded text-sm">
        <h3 className="font-bold mb-2">Debug Info (Remove in production):</h3>
        <div className="grid grid-cols-2 gap-2">
          <div>Users: {getValue('Users')}</div>
          <div>Orders: {getValue('Orders')}</div>
          <div>Products: {getValue('Products')}</div>
          <div>Categories: {getValue('Categories')}</div>
        </div>
        <div className="mt-2">
          <strong>Raw data:</strong> {JSON.stringify(data.totalData, null, 2)}
        </div>
      </div>

      {/* Card Start */}
      <div className="m-4 grid grid-cols-1 md:grid-cols-4 gap-4">
        <div className="flex flex-col justify-center items-center bg-white p-6 shadow-lg hover:shadow-xl cursor-pointer transition-all duration-300 ease-in border-b-4 border-opacity-0 hover:border-opacity-100 border-indigo-200 rounded-lg">
          <div className="bg-indigo-200 p-3 cursor-pointer rounded-full mb-4">
            <svg
              className="w-6 h-6 text-indigo-600"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth={2}
                d="M17 20h5v-2a3 3 0 00-5.356-1.857M17 20H7m10 0v-2c0-.656-.126-1.283-.356-1.857M7 20H2v-2a3 3 0 015.356-1.857M7 20v-2c0-.656.126-1.283.356-1.857m0 0a5.002 5.002 0 019.288 0M15 7a3 3 0 11-6 0 3 3 0 016 0zm6 3a2 2 0 11-4 0 2 2 0 014 0zM7 10a2 2 0 11-4 0 2 2 0 014 0z"
              />
            </svg>
          </div>
          <div className="text-3xl font-bold text-gray-800 mb-2">
            {getValue('Users')}
          </div>
          <div className="text-sm font-medium text-gray-600">Centres Enrolled</div>
        </div>

        <div className="flex flex-col justify-center items-center bg-white p-6 shadow-lg hover:shadow-xl cursor-pointer transition-all duration-300 ease-in border-b-4 border-opacity-0 hover:border-opacity-100 border-red-200 rounded-lg">
          <div className="bg-red-200 p-3 cursor-pointer rounded-full mb-4">
            <svg
              className="w-6 h-6 text-red-600"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth={2}
                d="M9 5H7a2 2 0 00-2 2v12a2 2 0 002 2h10a2 2 0 002-2V7a2 2 0 00-2-2h-2M9 5a2 2 0 002 2h2a2 2 0 002-2M9 5a2 2 0 012-2h2a2 2 0 012 2m-3 7h3m-3 4h3m-6-4h.01M9 16h.01"
              />
            </svg>
          </div>
          <div className="text-3xl font-bold text-gray-800 mb-2">
            {getValue('Orders')}
          </div>
          <div className="text-sm font-medium text-gray-600">Requests</div>
        </div>

        <div className="flex flex-col justify-center items-center bg-white p-6 shadow-lg hover:shadow-xl cursor-pointer transition-all duration-300 ease-in border-b-4 border-opacity-0 hover:border-opacity-100 border-green-200 rounded-lg">
          <div className="bg-green-200 p-3 cursor-pointer rounded-full mb-4">
            <svg
              className="w-6 h-6 text-green-600"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
